const Hero = () => {
    return(
        <div className="hero">
            <div className="hero__left">
                <h2>Welcome to Risari!</h2>
                <p>Quick and free delivary for many of our products to many parts of the world</p>
                <p className="hero__call__">Ready to start shopping?</p>
            </div>
        </div>
    )
}

export default Hero
